import { Component } from '@angular/core';
@Component({
  selector: 'gc-marca-create',
  templateUrl: './marca-create.component.html',
})
export class MarcaCreateComponent {
  nome!: string;
cargaHoraria!: number;

constructor(private cursoService: CursoService){}
onChange(novoValorModalidade: Modalidade){
this.modalidade = novoValorModalidade;
}
save(){
const curso: Curso = {nome: this.nome, cargaHoraria:
this.cargaHoraria, modalidade: this.modalidade};
this.cursoService.save(curso).subscribe((res) => {
console.log(res);
},
error => console.log(error));
}
}
